import React from 'react';
import s from "./Household.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories.js";
import Adverts from "../../Adverts/Adverts";

import archtect from './../architect.svg';
import auto from './../auto.svg';
import fridge from './../fridge.svg';
import furniture from './../furniture.svg';

import {
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
  APPLIANCE, FURNITURE
} from "../../redux/UrlReducer";

const Household = () => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={IMMOVABLES.name} imgPath={archtect} urlCategory={IMMOVABLES.url}/>
            <Category nameCategory={TRANSPORT.name} imgPath={auto} urlCategory={TRANSPORT.url}/>
            <Subcategories nameSubCat={APPLIANCE.name} imgPath={fridge} urlCategory={HOUSEHOLD.url} urlSubcategory={APPLIANCE.url}/>
            <Subcategories nameSubCat={FURNITURE.name} imgPath={furniture} urlCategory={HOUSEHOLD.url} urlSubcategory={FURNITURE.url}/>
          </div>
        </div>
      </div>
  );
};

export default Household;
